import React from 'react'
import styles from '../styles/Search.module.css'

export const Search = () => {
  return (
    <div>
      <input className={styles.test} type="text" placeholder="Search.." />
      <button type="submit">
        <i class="fa fa-search"></i>
      </button>
    </div>
  );
}
